import React from "react";
import {Link} from 'react-router-dom'
import './App.css'


const Test = (props) => {
    const {prop1, prop2, prop3, onDelete} = props;

    const handleDelete = () => {
        onDelete();
    }



    return(
        <Link to="/fullweatherpage">
            <div className="weatherDiv" >
            <p>{prop1}</p>
            <p>{prop2}</p>
            <p>{prop3}</p>
            <button onClick={handleDelete}>-</button>
        </div>
        </Link>


    );
}


export default Test;
